import Link from 'next/link';
import React from 'react';
import { Button } from '../../components/Button';
import { Panel } from '../../components/Panel';
import faker from 'faker';
import { useRouter } from 'next/router';

const OverviewSubApp = () => {
	const router = useRouter();
	return (
		<div className="pt-6 grid grid-cols-7 gap-6">
			<div className="col-span-5">
				<Panel header={{ content: 'Profile Posts' }}>
					<ul className="">
						{[
							{
								name: faker.name.findName(),
								content: faker.lorem.text(),
							},
							{
								name: faker.name.findName(),
								content: faker.lorem.text(),
							},
							{
								name: faker.name.findName(),
								content: faker.lorem.text(),
							},
						].map((post) => {
							return (
								<li className="border-b-1 border-primary-border py-6 first:pt-0 last:border-b-0 last:pb-0">
									<div className="flex items-center space-x-3">
										<img
											src={faker.image.imageUrl()}
											className="w-10 h-10 rounded-sm"
										/>
										<p className="flex flex-col">
											<Link href="/users/1">
												<a className="text-yellow-400 font-medium">
													{post.name}
												</a>
											</Link>
											<span>10 days ago</span>
										</p>
									</div>
									<p className="overflow-hidden overflow-ellipse line-clamp-4 mt-2 text-white">
										{/* {post.content} */}
										Lorem ipsum dolor sit amet, consectetur adipiscing elit.
										Proin facilisis libero sit amet lobortis pellentesque.
										Integer congue eros sit amet malesuada ornare. Quisque
										convallis suscipit tellus, ac feugiat nisi lobortis quis.
										Vestibulum tempor justo id posuere aliquet. Nulla maximus
										erat dolor, eget euismod dui mattis quis. Vivamus velit
										enim, sollicitudin sit amet tellus vitae, pulvinar lacinia
										arcu. Sed vel sapien in mi elementum lacinia. Suspendisse
										molestie nisl a eros ultrices euismod. Donec eget faucibus
										lacus, et pretium dui. Proin dui lacus, lacinia sed lacus
										molestie, tempus mollis velit. Phasellus ut pretium libero.
										Pellentesque laoreet dolor libero, sit amet accumsan neque
										placerat eu. Sed eget tempus turpis, nec cursus felis.
										Pellentesque at nisl ac ante maximus feugiat aliquam vitae
										felis.
									</p>
								</li>
							);
						})}
					</ul>
				</Panel>
			</div>
			<div className="col-span-2 space-y-6">
				<Panel compact={true} header={{ content: 'Reputation Overview' }}>
					<div className="flex items-center justify-evenly">
						<div className="w-full flex items-center justify-center">
							<p className="text-positive-cta font-medium">22 Positive (98%)</p>
						</div>
						{/* <span
								className="border-1 border-primary-border"
								style={{ width: '1px' }}
							/> */}
						<div className="border-l-1 border-primary-border w-full flex items-center justify-center">
							<p className="text-negative-cta font-medium">2 Negative (2%)</p>
						</div>
					</div>
					<Link href={`/users/${router.query.id}?tab=reputation`} passHref>
						<Button
							outline={true}
							compact={true}
							className="w-full justify-center mt-6"
						>
							View all reputation
						</Button>
					</Link>
				</Panel>
				<Panel compact={true} header={{ content: 'Scam Reports' }}>
					<p>0 active scam reports</p>
					<p className="mt-1">0 previous scam reports</p>
				</Panel>
				<Panel compact={true} header={{ content: 'Account Details' }}>
					<p>
						Account age <span>10 days</span>
					</p>
					<p className="mt-1">0 previous scam reports</p>
				</Panel>
			</div>
		</div>
	);
};

export default OverviewSubApp;
